problem:
To find the remainder, we use polynomial long division:

\[
\begin{array}{r|llll}
x-3 & x^3 & -3x^2 & -9x & +30 \\
\cline{2-5}
& x^3 & -3x^2 & & \\
\cline{2-3}
& & 0 & -9x & \\
\cline{4-4}
& & & -9x & +30 \\
\cline{4-5}
& & & & 21 \\
\end{array}
\]

Therefore, the remainder is $\boxed{21}$.

The polynomial $z^7 + z^6 + z^5 + z^4 + z^3 + z^2 + z + 1$ is a cyclotomic polynomial, specifically the 8th cyclotomic polynomial.  The roots of this polynomial are the primitive 8th roots of unity, which are $\text{cis}\left(\frac{2k\pi}{8}\right) = \text{cis}\left(\frac{k\pi}{4}\right),$ for $k = 1, 3, 5, 7.$  Consider the unit vectors $(1,0),$ $\left(\frac{\sqrt{2}}{2},\frac{\sqrt{2}}{2}\right),$ $(0,1),$ and $\left(-\frac{\sqrt{2}}{2},\frac{\sqrt{2}}{2}\right).$  Then $P$ is formed by connecting these four points in clockwise order.  We can divide $P$ into a square and two 45-45-90 triangles, as shown below.

[asy]
unitsize(1 cm);

pair A, B, C, D, M;

A = dir(0);
B = dir(45);
C = dir(90);
D = dir(135);
M = (B + C)/2;

draw(A--B--C--D,red);
draw(A--C,blue);
draw(B--D,blue);

label("$1$", (A + B)/2, N);
label("$1$", (C + D)/2, N);
label("$\frac{\sqrt{2}}{2}$", (M + C)/2, E, red);
label("$\frac{\sqrt{2}}{2}$", (M + B)/2, W, red);
label("$\frac{\sqrt{2}}{2}$", (M + D)/2, N, blue);
[/asy]

The square is a $\frac{\sqrt{2}}{2} \times \frac{\sqrt{2}}{2}$ square, so it has area $\frac{1}{2},$ and each 45-45-90 triangle has area $\frac{1}{8}.$  Therefore, the area of $P$ is $\frac{1}{2} + 2 \cdot \frac{1}{8} = \frac{5}{4},$ giving us an answer of $5 + 4 + 2 + 1 = \boxed{12}.$

The volume of a tetrahedron with vertices $A, B, C, D$ can be calculated using the formula:

$$V = \frac{1}{6}|\vec{AB} \cdot (\vec{AC} \times \vec{AD})|$$

where $V$ is the volume of the tetrahedron, and $\vec{AB}, \vec{AC}, \vec{AD}$ are vectors formed by the vertices.

Calculating the vectors:
\begin{align*}
\vec{AB} &= (3-0, 0-1, 1-2) = (3, -1, -1) \\
\vec{AC} &= (4-0, 3-1, 6-2) = (4, 2, 4) \\
\vec{AD} &= (2-0, 3-1, 2-2) = (2, 2, 0)
\end{align*}

Calculating the volume:
\begin{align*}
\vec{AC} \times \vec{AD} &= \begin{vmatrix} \hat{i} & \hat{j} & \hat{k} \\ 4 & 2 & 4 \\ 2 & 2 & 0 \end{vmatrix} \\
&= \hat{i}(2\cdot4 - 4\cdot2) - \hat{j}(4\cdot0 - 2\cdot2) + \hat{k}(4\cdot2 - 2\cdot2) \\
&= \hat{i}(8 - 8) - \hat{j}(0 - 4) + \hat{k}(8 - 4) \\
&= \hat{i}(0) - \hat{j}(-4) + \hat{k}(4) \\
&= (0, 4, 4)
\end{align*}

Calculating the dot product $\vec{AB} \cdot (\vec{AC} \times \vec{AD})$:
\begin{align*}
\vec{AB} \cdot (\vec{AC} \times \vec{AD}) &= (3, -1, -1) \cdot (0, 4, 4) \\
&= 3(0) + (-1)(4) + (-1)(4) \\
&= -4 - 4 \\
&= -8
\end{align*}

Now, calculating the volume:
\begin{align*}
V &= \frac{1}{6}|-8| \\
&= \frac{1}{6}(8) \\
&= \boxed{\frac{4}{3}}
\end{align*}
